INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, "ペコリーヌとの出会い", 7, 2834, 10118, 91002, 20063115, "フリーマーケット会場", 40, 5118061, 8, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 1, 0);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, "マホとの出会い", 7, 2835, 10118, 91002, 20063115, "フリーマーケット会場", 40, 5118062, 8, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 1, 0);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, "アキノとの出会い", 7, 2837, 10118, 91002, 20063115, "ランドソル市街地", 40, 5118063, 8, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 1, 0);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, "ジュンとの出会い", 18, 4108402, 10118, 91002, 20063115, "フリーマーケット会場", 40, 5118064, 8, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 1, 0);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, "カオリとの出会い", 18, 4107402, 10118, 91002, 20063115, "フリーマーケット会場", 40, 5118065, 8, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 1, 0);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (2, "ニノンとの出会い", 16, 9000227, 10118, 91002, 20063115, "オーエド町", 40, 5118066, 8, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, 1);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, "スズナとの出会い", 19, 2101181, 10118, 91002, 20063115, "フリーマーケット会場", 40, 5118067, 8, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 1, 0);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, "ナナカとの出会い", 18, 4109402, 10118, 91002, 20063115, "ランドソル市街地", 40, 5118068, 8, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 1, 0);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, "キャル＆コッコロとの出会い", 18, 4305402, 10118, 91002, 20063115, "フリーマーケット会場", 40, 5118069, 8, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 1, 0);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, "ユカリとの出会い", 18, 4101402, 10118, 91002, 20063115, "ランドソル市街地", 40, 5118070, 8, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 1, 0);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, "アオイとの出会い", 18, 4106402, 10118, 91002, 20063115, "ランドソル市街地", 40, 5118071, 8, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 1, 0);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (3, "シノブとの出会い", 7, 2836, 10118, 91002, 20063115, "フリーマーケット会場", 40, 5118072, 8, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, 1);
INSERT INTO `v1_e100e9d9c2cd34110625683b0748e41ce914ace333e83fb134323e89b34fec49` VALUES (1, "オープニング", 0, 0, 10118, 0, 20063115, 0, 0, 5118600, 0, "彼女たちの新たな日常", 0, 0, 0);
